// components/Dashboard.js
import React ,{useState ,useEffect} from 'react';
import axios from 'axios'
import {useParams , useNavigate} from 'react-router-dom'
// import User from '../../../backend/model/User';

const UserDashboard = ({token}) => {
  const [formData, setFormData]= useState({
    email: "",
    password: "",
    name: "",
    address: "",
    profile: "",
    phone: "",

  })
  const {id } = useParams()
  console.log("BOOK ID", id)
  const navigate = useNavigate()
  useEffect(()=>{
    console.log("BOOK ID", id)
    axios.get(`http://localhost:5000/api/user/${id}`)
    .then((res)=>{
      setFormData({
        title:res.data.email,
        isbn:res.data.password,
        author:res.data.name,
        description:res.data.address,
        published_date:res.data.profile,
        publisher:res.data.phone
      })
    })
    .catch((err)=>{
      console.log('Error from UpdateBookInfo')
    })
  },[id])
  const onChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };
  const onSubmit = (e) => {
    e.preventDefault();

    const data = {
      title:formData.title,
      isbn: formData.isbn,
      author: formData.author,
      description: formData.description,
      published_date: formData.published_date,
      publisher: formData.publisher,
    };

    axios
      .put(`http://localhost:5000/api/user/${id}`, data)
      .then((res) => {
        navigate(`/show-book/${id}`);
      })
      .catch((err) => {
        console.log('Error in UpdateBookInfo!');
      });
  };

  return (
    <div>
      <h2>Welcome to Your Dashboard</h2>
      <form noValidate  onSubmit={onSubmit}>
            <div className='form-group'>
              <label htmlFor='title'>Title</label>
              <input
                type='text'
                placeholder='Title of the Book'
                name='title'
                className='form-control'
                value={book.title}
                onChange={onChange}
              />
            </div>
            <br />

            <div className='form-group'>
              <label htmlFor='isbn'>ISBN</label>
              <input
                type='text'
                placeholder='ISBN'
                name='isbn'
                className='form-control'
                value={book.isbn}
                onChange={onChange}
              />
            </div>
            <br />

            <div className='form-group'>
              <label htmlFor='author'>Author</label>
              <input
                type='text'
                placeholder='Author'
                name='author'
                className='form-control'
                value={book.author}
                onChange={onChange}
              />
            </div>
            <br />

            <div className='form-group'>
              <label htmlFor='description'>Description</label>
              <textarea
                type='text'
                placeholder='Description of the Book'
                name='description'
                className='form-control'
                value={book.description}
                onChange={onChange}
              />
            </div>
            <br />

            <div className='form-group'>
              <label htmlFor='published_date'>Published Date</label>
              <input
                type='text'
                placeholder='Published Date'
                name='published_date'
                className='form-control'
                value={book.published_date}
                onChange={onChange}
              />
            </div>
            <br />

            <div className='form-group'>
              <label htmlFor='publisher'>Publisher</label>
              <input
                type='text'
                placeholder='Publisher of the Book'
                name='publisher'
                className='form-control'
                value={book.publisher}
                onChange={onChange}
              />
            </div>
            <br />
            </form>


    </div>
  );
};

export default UserDashboard;
